import React, { useReducer } from "react";
import styled from "styled-components";
import { useParams } from "react-router-dom";

const ReviewDay = (props) => {
    const day = useParams();
    console.log(day)
    console.log(props.day)
    let what_day = React.useRef(day)
    return (

        <div style={{ textAlign: "center", wordBreak: "keep-all" }}>
            <h1 ref={what_day}> 요일 평점 남기기 </h1>
            <button style={{
                margin: "0.1em 0em",
                backgroundColor: "#8977ad",
                borderRadius: "30px",
                padding: "14px",
                width: "30vw",
                border: "1px",
                color: "white",
                fontWeight: "bold",
                fontSize: "1.1em"
            }}>평점 남기기</button>
        </div>

    )
}

export default ReviewDay;
